import React from "react";
import Navbar from "./Navbar";
import { Box, ListItem, ListItemText, ListSubheader } from "@mui/material";

const Home = () => {
  return (
    <div>
      <Navbar />
      <p>Welcome, user</p>
      <div className="all-papers" style={{ display: "flex" }}>
        <Box
          sx={{
            width: "100%",
            height: 400,
            maxWidth: 360,
            bgcolor: "pink",
          }}
        >
          <ListSubheader>Practice Papers</ListSubheader>
          <ListItem>
            <ListItemText component="div" primary = "Physics" secondary = "2019"></ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText component="div" primary = "Physics" secondary = "2019">first</ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
        </Box>
        <Box
          sx={{
            width: "100%",
            height: 400,
            maxWidth: 360,
            bgcolor: "pink",
          }}
        >
          <ListSubheader>Completed Papers</ListSubheader>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
        </Box>
      </div>
    </div>
  );
};

export default Home;
